import { BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import { withService } from '../hoc';
import {Home, Items} from '../pages';
import './app.css';

const App = ({shopService}) =>{
    const item = shopService.getItem();
    return(
        <Router>
            <div> 
                <p>
                    My new store!
                    <br/>
                    {item}
                </p>
                <br/>
                <Switch>
                    <Route path='/' component={Home} exact/>
                    <Route path='/item' component={Itemы}/>
                </Switch>
            </div>
        </Router>
    )
}
export default withService()(App);
